De jonge robot Rodney Copperbottom is de zoon van een arme bordenwasser. Hij verhuist naar Robot City, in de hoop het daar te 
maken als uitvinder. Dit blijkt echter niet mee te vallen: zijn idool Bigweld is nergens te vinden, en zijn bedrijf wordt 
gerund door de op geld belustte robot Ratchet.
